			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Set the target folders and the final framework product.\nFramework_NAME=\"PayeezyClient\"\nFramework_VERSION=\"1.0\"\n\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\nINSTALL_DIR=${SRCROOT}/../Builds/${Framework_VERSION}/${Framework_NAME}.framework\n\n# Working dir is the place where we do all our dirty things (copy, merge, remove) framework creation.\nWRK_DIR=build\nDEVICE_DIR=${WRK_DIR}/Release-iphoneos/${Framework_NAME}.framework\nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator/${Framework_NAME}.framework\n\n# Building both architectures.\nxcodebuild -configuration \"Release\" -target \"${Framework_NAME}\" -sdk iphoneos\nxcodebuild -configuration \"Release\" -target \"${Framework_NAME}\" -sdk iphonesimulator\n\n# If older version of frameworks are present just remove them\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\n\nmkdir -p \"${INSTALL_DIR}\"\nmkdir -p \"${INSTALL_DIR}/Versions\"\nmkdir -p \"${INSTALL_DIR}/Versions/${Framework_VERSION}\"\nmkdir -p \"${INSTALL_DIR}/Versions/${Framework_VERSION}/Resources\"\nmkdir -p \"${INSTALL_DIR}/Versions/${Framework_VERSION}/Headers\"\n\nln -s \"${Framework_VERSION}\" \"${INSTALL_DIR}/Versions/Current\"\nln -s \"Versions/Current/Headers\" \"${INSTALL_DIR}/Headers\"\nln -s \"Versions/Current/Resources\" \"${INSTALL_DIR}/Resources\"\nln -s \"Versions/Current/${Framework_NAME}\" \"${INSTALL_DIR}/${Framework_NAME}\"\n\ncp -R \"${DEVICE_DIR}/Headers/\" \"${INSTALL_DIR}/Versions/${Framework_VERSION}/Headers/\"\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/Versions/${Framework_VERSION}/Resources/\"\n\n\n# Lipo output (i386 + armv6/armv7) into one Universal final product.\nlipo -create \"${DEVICE_DIR}/${Framework_NAME}\" \"${SIMULATOR_DIR}/${Framework_NAME}\" -output \"${INSTALL_DIR}/Versions/${Framework_VERSION}/${Framework_NAME}\"\n\nrm -rf \"${WRK_DIR}\"\n";
		};
